script: |
  super -f text -I q7200.spq | sort > q7200.out

inputs:
  - name: q7200.spq
    data: |
      SELECT DISTINCT + 68 * col0 + - col0 * ( - cor0.col1 ) * cor0.col0 AS col0 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q7200.out
    data: |
      438
      45312
      88640
